scriptlet.script:
myData = reasonCode; 

var valueLength = myData.length;
var fieldLength = 15;
var spacesReqd = fieldLength - valueLength;
var spaces="";
for(var i=1;i<=spacesReqd;i++)
{
  spaces+=" ";
}
result = myData+spaces;

// To set the response of the operation (must match one of the responses from the Responses tab): 
//scriptletResponse = "success"; 

// To set the result of the operation 
scriptletResult = result; 

// To set the Local Variable for the flow 
scriptletContext.put("reasonCode",result);
